INSERT INTO `gvms_tb_email_templates` (`id`, `type`, `subject`, `body`, `smtp_host`, `smtp_port`, `smtp_username`, `smtp_password`, `from_email`, `created`, `modified`) VALUES
(1, 'Welcome Email For Outlet', 'Welcome To Voucher Plus', '<p>Hi {{outlet.name}},</p>\r\n\r\n<p>Welcome to Voucher Plus.&nbsp;</p>\r\n\r\n<p>Please check your online store&nbsp;by clicking on the below link:</p>\r\n\r\n<p>{{outlet.accessurl}}&nbsp;</p>\r\n\r\n<p><strong>Login information for your&nbsp;Administrator Panel:</strong></p>\r\n\r\n<p>Go to&nbsp;Outlet Login Panel -&nbsp; {{outlet.loginurl}}</p>\r\n\r\n<p>Outlet Email: {{outlet.email}}</p>\r\n\r\n<p>Password: {{outlet.password}}</p>\r\n\r\n<p>Once logged in:</p>\r\n\r\n<p>Click on Profile: to change your business information.</p>\r\n\r\n<p>Click on Voucher Manager: to change exisitng vouchers, or add new vouchers.</p>\r\n\r\n<p>Click on Purchased Voucher Manager: to view all purchased vouchers and to redeem incoming vouchers.</p>\r\n\r\n<p><strong>Social Media:</strong></p>\r\n\r\n<p>Share the below link on Facebook, Instagram &amp; other social sites:</p>\r\n\r\n<p>{{outlet.accessurl}}&nbsp;</p>\r\n\r\n<p>To send a bulk SMS with your voucher plus link contact Angela Dent 0431 423 272</p>\r\n\r\n<p>To setup a Facebook Shop for your voucher page contact Angela Dent 0431 423 272</p>\r\n\r\n<p>Thanks</p>\r\n\r\n<p>{{sitename}}</p>', '', 0, '', '', 'admin@voucherplus.com.au', '2017-05-17 00:00:00', '2018-02-21 15:21:55'),
(2, 'Order Confirmation For Buyer (Self)', 'Your {{voucher_name}} voucher from {{business_name}}', '<p>Hi {{purchaser_name}},</p>\r\n\r\n<p>thank you for your purchase from {{business_name}}</p>\r\n\r\n<p>Click here to view your voucher or copy and paste the below link into your browser.</p>\r\n\r\n<p>{{voucher_url}}.</p>\r\n\r\n<p>Thanks you</p>\r\n\r\n<p>{{business_name}}</p>', '', 0, '', '', 'admin@voucherplus.com.au', '2017-06-22 00:00:00', '2017-07-26 19:24:51'),
(3, 'Order Confirmation For Buyer (Other)', 'Order Confirmation - {{business_name}}', '<p>Hi {{purchaser_name}},</p>\r\n\r\n<p>Thank you for purchasing a gift voucher(s) for {{recipient_name}} from {{business_name}}.</p>\r\n\r\n<p>An email and sms will be sent to the recipient on {{schedule_date}}</p>\r\n\r\n<p>Thanks you.</p>\r\n\r\n<p>{{business_name}}</p>', '', 0, '', '', 'admin@voucherplus.com.au', '2017-06-22 00:00:00', '2018-08-02 13:25:32'),
(4, 'Order Confirmation For Receiver', '{{voucher_name}} - sent by {{purchaser_name}} - Gift Voucher', '<p>Hi {{recipient_name}},</p>\r\n\r\n<p>you have received a gift voucher(s) from {{purchaser_name}}.</p>\r\n\r\n<p>Please click here to view your gift voucher or copy and paste the below into your browser.</p>\r\n\r\n<p>{{giftvoucher_url}}</p>\r\n\r\n<p>Thanks you</p>\r\n\r\n<p>{{business_name}}</p>', '', 0, '', '', 'admin@voucherplus.com.au', '2017-06-22 00:00:00', '2017-11-13 21:37:14'),
(5, 'Order Confirmation For Outlet', 'New Order - {{site_name}}', '<p>Dear {{business_name}},</p>\r\n\r\n<p>There has been a recent purchase from your online store</p>\r\n\r\n<p>User Details:</p>\r\n\r\n<p>Name - {{purchaser_name}}</p>\r\n\r\n<p>Phone - {{purchaser_mobile}}</p>\r\n\r\n<p>Email - {{purchaser_email}}</p>\r\n\r\n<p>Order Details:</p>\r\n\r\n<p>{{order_details}}</p>\r\n\r\n<p>Thanks</p>\r\n\r\n<p>{{site_name}}</p>', '', 0, '', '', 'admin@voucherplus.com.au', '2017-06-22 00:00:00', '2017-08-11 22:34:54'),
(6, 'Forgot Password Email For Outlet', 'Password Reset Link - {{site_name}}', '<p>Hi,</p>\r\n\r\n<p>We have received a request for password reset.</p>\r\n\r\n<p>Click here to reset your password or copy and paste the below link in your browser.</p>\r\n\r\n<p>{{business_forgoturi}}</p>\r\n\r\n<p>The above link will be active for next 3 days only.</p>\r\n\r\n<p>Thanks</p>\r\n\r\n<p>{{site_name}}</p>', '', 0, '', '', 'admin@voucherplus.com.au', '2017-06-22 00:00:00', '2017-08-16 18:10:43'),
(7, 'Resend Voucher Link', 'Voucher resent: {{voucher_name}} - {{business_name}}', '<p>Please click here to view your gift voucher or copy and paste the below into your browser.</p>\r\n\r\n<p>{{giftvoucher_url}}</p>\r\n\r\n<p>Thank&nbsp;you</p>\r\n\r\n<p>{{business_name}}</p>', '', 0, '', '', 'admin@voucherplus.com.au', '2017-08-10 00:00:00', '2018-03-14 11:52:41');
