(468, 72, 'ENVIRON – VITA-ANTIOXIDANT HYDRATING OIL CAPSULES (33% EXTRA FREE)', '40 capsules for the price of 30 capsules! These perfect, single-dose capsules of ‘liquid gold’ deliver a highly concentrated burst of vitamin enriched hydration for the skin. Containing a blend of Retinol, Antioxidants and oils they help to protect the skin against the damaging effects of free radicals and photo-ageing. They assist in enriching skin with natural moisturising oils so similar to its natural lipids, that are quickly absorbed, leaving no oily residue.', 110, 0, 'Voucher_logo_5bea6aaa5fcdb0.87990259.png', 14, 0, 1, 3, '2018-11-13 17:09:46', '2018-11-22 17:55:52'),
(469, 72, 'ENVIRON – REVIVAL MASQUE  (WITH 10 HYDRATING OIL CAPSULES PACK FREE)', 'The intensive reviving, exfoliating, tightening and lifting masque has a unique combination of three hydroxy acid ingredients formulated to specifically target the effects of photo-damaged skin and the appearance of uneven skin texture. Lactic Acid increases the look of hydration in the skin and it is known to lighten the appearance of pigmented marks. Research has shown that Asiatic Acid helps to regenerated skin. Mandelic Acid is useful in rejuvenating the appearance of pigmented areas.', 110, 0, 'Voucher_logo_5bebb4bc814981.26937236.png', 13, 0, 1, 3, '2018-11-14 16:38:04', '2018-11-22 17:54:53'),
(470, 72, 'ENVIRON – AVANCE ELIXIR PEPTIDE SERUM (66% EXTRA FREE - 50 Ml For The Price Of 30ml!', 'This powerhouse of peptide complexes and chinese herbal extracts, will help keep your skin looking radiantly luminous and resiliently younger, for longer. The Avance Elixir has been formulated using Meiritage, a unique blend of Chinese root extracts and three powerful peptide complexes (Matrixyl 3000, Trylagen, and Matrixyl Synthé 6). It’s an anti-ageing product that has multifunctional benefits, targeting three signs of ageing: dehydration, wrinkles, and hyperpigmentation. Can be added to your daily routine when the signs of sun damage and ageing are starting to present.', 152, 0, 'Voucher_logo_5bebbac29367a5.13972351.png', 12, 0, 1, 3, '2018-11-14 17:03:46', '2018-11-22 17:54:44'),
