(480, 72, 'EYENVY LASH & BROW CONDITIONER SERUM', 'GREAT STOCKING FILLERS! EyEnvy® serum is now Canada\'s #1 lash and brow conditioner, exclusive to retail through skin and beauty clinics! Making its way across the globe it is increasingly becoming everyone\'s must-have serum! The serum helps improve length, fullness, thickness to your own natural lashes. Typically most individuals start seeing results within 4-6 weeks. Full results are achieved within 3 months', 120, 100, 'Voucher_logo_5bf4c149add955.13945200.png', 14, 0, 1, 3, '2018-11-21 13:22:01', '2018-11-22 17:56:06'),
(481, 72, 'JADE IREDALE  MAGIC MITT', 'GREAT STOCKING FILLER!', 35, 30, 'Voucher_logo_5bf4c1eb00cdc6.90687766.png', 15, 0, 1, 3, '2018-11-21 13:24:42', '2018-11-21 13:25:51'),
(482, 72, 'JADE IREDALE  MAGIC MITT', 'GREAT STOCKING FILLER!', 35, 30, 'Voucher_logo_5bf4c23dd99261.46117811.png', 15, 0, 1, 3, '2018-11-21 13:24:44', '2018-11-22 17:56:16'),
(483, 72, 'WRINKLES SCHMINKLES XMAS KIT FOR WOMEN', 'Treasure your neck and décolletage areas, those most age-telling of body parts! This Christmas gift the sisterhood (or yourself) the gift of a wrinkle-free neck, & décolletage! Worn overnight, every night, these re-usable, 100% Medical Grade Silicone Pads are proven to correct and prevent wrinkles by keeping the skin taut, so it quite simply cannot crease or wrinkle while you enjoy your most heavenly side-sleep. Last for approximately 3 months with daily use. Dream Christmas skin? Right this way! IN THIS KIT: 1 x Chest Smoothing Kit & 1 x Neck Smoothing Kit', 80, 70, 'Voucher_logo_5bf4c4f241c4e0.31823277.png', 16, 0, 1, 3, '2018-11-21 13:36:31', '2018-11-22 17:56:37'),
(484, 72, 'WRINKLES SCHMINKLES XMAS KIT FOR MEN', 'Here’s what we know about you Men…you get better with age (think George Clooney), you are notoriously relaxed with your skincare regime, but…you notice that what comes with your distinguished appearance as you age, is those dreaded forehead and eye wrinkles that are especially exaggerated during the festive season. If all you want for Christmas is your best chance for that special kiss under the mistletoe, then gift yourself our special Anti-Brotox Duo Kit. These two 100% Medical Grade Silicone Pads will help smooth wrinkles on the forehead and around the eyes to visibly soften and relieve wrinkles while eliminating dark circles and puffy under-eyes. It\'s a Christmas miracle! IN THIS KIT: 1 x Eye Smoothing Kit & 1 x Forehead Smoothing Kit', 80, 70, 'Voucher_logo_5bf4ca5ae2a246.57403180.png', 16, 0, 1, 3, '2018-11-21 14:00:42', '2018-11-22 17:56:30'),
(485, 73, 'Skin Needling For Face & Hands', 'Skin Needling is a new treatment to reduce the appearance of fine lines, acne scars and improve the skin’s overall appearance. In this procedure tiny needles are used to create controlled micro-injuries to the skin in order to produce collagen and elastin. The skin’s repair process results in a thicker dermis with the appearance of softer wrinkles. The procedure also allows topical gels, creams and serums to be absorbed more effectively into the skin.', 700, 397, 'Voucher_logo_5bfcb297bd2492.26069383.png', 1, 1, 1, 3, '2018-11-27 13:56:21', '2019-02-21 11:01:40'),
(486, 73, 'Microblading Or Block Tattooing', 'Clients can enhance their natural features with this Microblading treatment for the eyebrows or opt for block tattooing.', 800, 350, 'Voucher_logo_5c3d710626a0c5.34858419.jpg', 2, 1, 1, 3, '2018-11-29 17:34:46', '2019-02-21 11:01:33'),
